      <!-- Parabola: y = x^2 - x - 2 -->
      <!-- Adjusted to open UP (U-shape). Math Y inverted to SVG Y. -->
      <!-- Vertex (math): (0.5, -2.25) -> SVG: (0.5, 2.25) -->
